import classes from './MealsSummary.module.css';

const MealsSummary = () => {
    return (
        <section className={classes.summary}>
            <h2>Best Japanese Restaurant in Waterloo</h2>
            <p>
        Eat this is getting good life
            </p>
            <p>
        something you wouldn't regret try
            </p>
        </section>
    );
};

export default MealsSummary;
